import { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, X, ExternalLink } from 'lucide-react';

const Projects = () => {
    const navigate = useNavigate();
    const [selectedProject, setSelectedProject] = useState(null);

    const projects = [
        {
            id: 1,
            title: "Compare AI",
            shortDesc: "AI-powered facial comparison platform",
            longDesc: "Compare AI is an innovative web application that uses advanced artificial intelligence to analyze and compare facial features. The platform allows users to upload photos and receive detailed comparisons, rankings, and insights powered by cutting-edge AI technology. Built with modern web technologies, it features a sleek user interface, real-time processing, and a global leaderboard system. The application demonstrates expertise in AI integration, responsive design, and creating engaging user experiences.",
            image: "data:image/png;base64,",
            color: "red",
            url: "https://compare-ai.site"
        },
        {
            id: 2,
            title: "Sundown Studio Clone",
            shortDesc: "Creative agency website recreation",
            longDesc: "A pixel-perfect clone of the Sundown Studio website, showcasing advanced front-end development skills and attention to detail. This project demonstrates mastery of modern web animations, smooth scrolling effects, and responsive design principles. Built with HTML, CSS, and JavaScript, featuring interactive elements, dynamic content loading, and sophisticated visual effects that replicate the original studio's premium aesthetic. The clone highlights expertise in UI/UX implementation and creative web development.",
            image: "data:image/png;base64,",
            color: "green",
            url: "https://aryancoding77.github.io/sundown-studio/"
        },
        {
            id: 3,
            title: "Muscle AI",
            shortDesc: "AI-powered muscle transformation video maker",
            longDesc: "Muscle AI is an innovative video maker app available on the Apple App Store that transforms photos into entertaining muscle transformation videos using advanced AI technology. Users simply upload any photo, and the AI instantly creates realistic muscle animations and flexing clips in just a few taps, without requiring any video editing skills. The app generates viral-worthy content perfect for social media sharing, designed to make friends laugh and create engaging posts using hashtags like #MuscleAI and #MuscleTransformation. Operating on a subscription-based model, Muscle AI maintains high-quality AI video generation capabilities, handling the computational costs of creating these realistic muscle transformations that have become popular across social platforms.",
            image: "data:image/png;base64,",
            color: "yellow",
            url: "https://muscleai.site"
        },
        {
            id: 4,
            title: "DeepTech",
            shortDesc: "Modern technology showcase platform",
            longDesc: "DeepTech is a cutting-edge web application deployed on Vercel that showcases advanced technology solutions and innovations. Built with modern web frameworks, the platform features a sleek, responsive design with smooth animations and interactive elements. The project demonstrates expertise in full-stack development, cloud deployment, and creating engaging user experiences. Utilizing the latest web technologies and best practices, DeepTech delivers fast performance, seamless navigation, and a professional interface that highlights technological capabilities and innovation in the digital space.",
            image: "data:image/png;base64,",
            color: "blue",
            url: "https://deeptech-eta.vercel.app/"
        },

    ];

    const getColorClasses = (color) => {
        const colors = {
            red: "border-red-500 hover:bg-red-500/10",
            green: "border-green-500 hover:bg-green-500/10",
            yellow: "border-yellow-500 hover:bg-yellow-500/10",
            blue: "border-blue-500 hover:bg-blue-500/10",
            orange: "border-orange-500 hover:bg-orange-500/10",
            emerald: "border-emerald-500 hover:bg-emerald-500/10",
            pink: "border-pink-500 hover:bg-pink-500/10",
            purple: "border-purple-500 hover:bg-purple-500/10"
        };
        return colors[color] || colors.red;
    };

    return (
        <div className="min-h-screen bg-gray-100 flex items-center justify-center p-0 lg:p-8">
            <div className="relative w-full max-w-[1920px] min-h-screen">
                
                {/* Back Button */}
                <motion.button
                    onClick={() => navigate('/')}
                    className="fixed top-6 left-6 lg:left-16 z-50 w-12 h-12 rounded-full bg-white/10 backdrop-blur-sm border border-white/20 flex items-center justify-center hover:bg-white/20 transition-all"
                    whileHover={{ scale: 1.1 }}
                    whileTap={{ scale: 0.9 }}
                >
                    <ArrowLeft className="text-white" size={24} />
                </motion.button>

                <motion.div
                    className="relative w-full min-h-screen bg-[#050505] rounded-none lg:rounded-[40px] overflow-hidden border-0 lg:border-t-[3px] lg:border-l-[3px] lg:border-r-[3px] lg:border-b-[6px] lg:border-white"
                    initial={{ scale: 0.95, opacity: 0 }}
                    animate={{ scale: 1, opacity: 1 }}
                    transition={{ duration: 0.5 }}
                >
                    {/* Background Effects */}
                    <div className="absolute inset-0 bg-gradient-radial from-red-900/30 via-transparent to-transparent opacity-50 z-0" />
                    <div className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 w-[800px] h-[800px] bg-red-600/20 rounded-full blur-[120px] z-0" />
                    
                    {/* Grid Pattern */}
                    <div 
                        className="absolute inset-0 z-0"
                        style={{
                            backgroundImage: `
                                repeating-linear-gradient(0deg, transparent, transparent 40px, rgba(255, 255, 255, 0.08) 40px, rgba(255, 255, 255, 0.08) 41px),
                                repeating-linear-gradient(90deg, transparent, transparent 40px, rgba(255, 255, 255, 0.08) 40px, rgba(255, 255, 255, 0.08) 41px)
                            `,
                            backgroundSize: '40px 40px',
                            opacity: 0.4
                        }}
                    />

                    {/* Vignette */}
                    <div 
                        className="absolute inset-0 z-0"
                        style={{
                            background: 'radial-gradient(ellipse at center, transparent 0%, transparent 30%, rgba(0,0,0,0.5) 70%, rgba(0,0,0,0.8) 100%)'
                        }}
                    />

                    {/* Content */}
                    <div className="relative z-10 min-h-screen px-6 md:px-16 py-20">
                        
                        {/* Header */}
                        <motion.div
                            className="text-center mb-16"
                            initial={{ y: -50, opacity: 0 }}
                            animate={{ y: 0, opacity: 1 }}
                            transition={{ delay: 0.2, duration: 0.6 }}
                        >
                            <h1 
                                className="text-5xl md:text-7xl lg:text-8xl font-bold text-white mb-6 tracking-wider"
                                style={{ fontFamily: "'Orbitron', sans-serif" }}
                            >
                                MY <span className="text-red-500">PROJECTS</span>
                            </h1>
                            <p 
                                className="text-white/70 text-lg md:text-xl max-w-2xl mx-auto"
                                style={{ fontFamily: "'Inter', sans-serif" }}
                            >
                                Explore my portfolio of web development projects
                            </p>
                        </motion.div>

                        {/* Projects Grid */}
                        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6 max-w-7xl mx-auto">
                            {projects.map((project, index) => (
                                <motion.div
                                    key={project.id}
                                    className="relative backdrop-blur-md bg-white/10 rounded-2xl overflow-hidden cursor-pointer transition-all group"
                                    initial={{ opacity: 0, y: 50 }}
                                    animate={{ opacity: 1, y: 0 }}
                                    transition={{ delay: 0.1 * index, duration: 0.5 }}
                                    onClick={() => setSelectedProject(project)}
                                    whileHover={{ scale: 1.05 }}
                                    whileTap={{ scale: 0.98 }}
                                >
                                    {/* Animated gradient border */}
                                    <div className="absolute inset-0 rounded-2xl bg-gradient-to-r from-red-500 via-purple-500 to-blue-500 opacity-0 group-hover:opacity-100 transition-opacity duration-300 blur-sm" />
                                    <div className="absolute inset-[2px] rounded-2xl bg-[#050505] z-10" />
                                    
                                    {/* Content wrapper */}
                                    <div className="relative z-20">
                                    <div className="aspect-[4/3] overflow-hidden">
                                        <img 
                                            src={project.image} 
                                            alt={project.title}
                                            className="w-full h-full object-cover group-hover:scale-110 transition-transform duration-500"
                                        />
                                    </div>
                                        <div className="p-5">
                                            <h3 
                                                className="text-xl font-bold text-white mb-2 tracking-wide"
                                                style={{ fontFamily: "'Orbitron', sans-serif" }}
                                            >
                                                {project.title}
                                            </h3>
                                            <p 
                                                className="text-white/70 text-sm"
                                                style={{ fontFamily: "'Inter', sans-serif" }}
                                            >
                                                {project.shortDesc}
                                            </p>
                                        </div>
                                    </div>
                                </motion.div>
                            ))}
                        </div>

                        {/* Decorative Elements */}
                        <div className="absolute top-[15%] left-[8%] w-2 h-2 bg-red-500/50 rounded-full shadow-[0_0_20px_rgba(239,68,68,0.8)]" />
                        <div className="absolute top-[25%] right-[12%] w-2 h-2 bg-red-500/50 rounded-full shadow-[0_0_20px_rgba(239,68,68,0.8)]" />
                        <div className="absolute bottom-[20%] left-[10%] w-2 h-2 bg-red-500/50 rounded-full shadow-[0_0_20px_rgba(239,68,68,0.8)]" />
                        <div className="absolute bottom-[15%] right-[8%] w-2 h-2 bg-red-500/50 rounded-full shadow-[0_0_20px_rgba(239,68,68,0.8)]" />
                    </div>
                </motion.div>
            </div>

            {/* Fullscreen Project Modal */}
            <AnimatePresence>
                {selectedProject && (
                    <motion.div
                        className="fixed inset-0 z-[100] flex items-center justify-center p-0 md:p-4"
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        exit={{ opacity: 0 }}
                    >
                        {/* Backdrop */}
                        <motion.div
                            className="absolute inset-0 bg-black/90 backdrop-blur-sm"
                            initial={{ opacity: 0 }}
                            animate={{ opacity: 1 }}
                            exit={{ opacity: 0 }}
                            onClick={() => setSelectedProject(null)}
                        />

                        {/* Modal Content */}
                        <motion.div
                            className="relative w-full h-full md:h-auto md:max-w-4xl md:max-h-[90vh] bg-[#050505] rounded-none md:rounded-3xl overflow-hidden border-0 md:border-2 md:border-white/20"
                            initial={{ scale: 0.5, opacity: 0, rotateX: 90 }}
                            animate={{ scale: 1, opacity: 1, rotateX: 0 }}
                            exit={{ scale: 0.5, opacity: 0, rotateX: -90 }}
                            transition={{ type: "spring", damping: 25, stiffness: 300 }}
                        >
                            {/* Close Button */}
                            <button
                                onClick={() => setSelectedProject(null)}
                                className="absolute top-6 right-6 z-10 w-10 h-10 rounded-full bg-white/10 backdrop-blur-sm border border-white/20 flex items-center justify-center hover:bg-white/20 transition-all"
                            >
                                <X className="text-white" size={20} />
                            </button>

                            {/* Scrollable Content */}
                            <div className="overflow-y-auto h-full md:max-h-[90vh] custom-scrollbar">
                                {/* Project Image */}
                                <div className="w-full h-[50vh] md:h-[400px] overflow-hidden">
                                    <motion.img 
                                        src={selectedProject.image} 
                                        alt={selectedProject.title}
                                        className="w-full h-full object-cover"
                                        initial={{ scale: 1.2 }}
                                        animate={{ scale: 1 }}
                                        transition={{ duration: 0.8 }}
                                    />
                                </div>

                                {/* Project Details */}
                                <div className="p-6 md:p-8 lg:p-12">
                                    <motion.h2 
                                        className="text-3xl md:text-4xl lg:text-5xl font-bold text-white mb-4 md:mb-6 tracking-wider"
                                        style={{ fontFamily: "'Orbitron', sans-serif" }}
                                        initial={{ y: 20, opacity: 0 }}
                                        animate={{ y: 0, opacity: 1 }}
                                        transition={{ delay: 0.2 }}
                                    >
                                        {selectedProject.title}
                                    </motion.h2>
                                    
                                    <motion.p 
                                        className="text-white/80 text-base md:text-lg leading-relaxed mb-6 md:mb-8"
                                        style={{ fontFamily: "'Inter', sans-serif" }}
                                        initial={{ y: 20, opacity: 0 }}
                                        animate={{ y: 0, opacity: 1 }}
                                        transition={{ delay: 0.3 }}
                                    >
                                        {selectedProject.longDesc}
                                    </motion.p>

                                    {/* View Project Button */}
                                    <motion.a
                                        href={selectedProject.url}
                                        target="_blank"
                                        rel="noopener noreferrer"
                                        className="inline-flex items-center gap-3 border-2 border-red-500 bg-red-500/10 text-white px-6 md:px-8 py-3 md:py-4 rounded-full hover:bg-red-500 hover:border-red-500 transition-all text-sm md:text-base font-semibold tracking-wide group"
                                        style={{ fontFamily: "'Orbitron', sans-serif" }}
                                        initial={{ y: 20, opacity: 0 }}
                                        animate={{ y: 0, opacity: 1 }}
                                        transition={{ delay: 0.4 }}
                                        whileHover={{ scale: 1.05 }}
                                        whileTap={{ scale: 0.95 }}
                                    >
                                        VIEW PROJECT
                                        <ExternalLink size={20} className="group-hover:translate-x-1 transition-transform" />
                                    </motion.a>
                                </div>
                            </div>
                        </motion.div>
                    </motion.div>
                )}
            </AnimatePresence>

            {/* Google Fonts */}
            <style>{`
                @import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700;900&family=Inter:wght@400;500;600&display=swap');
                
                .custom-scrollbar::-webkit-scrollbar {
                    width: 8px;
                }
                
                .custom-scrollbar::-webkit-scrollbar-track {
                    background: rgba(255, 255, 255, 0.05);
                    border-radius: 10px;
                }
                
                .custom-scrollbar::-webkit-scrollbar-thumb {
                    background: rgba(239, 68, 68, 0.5);
                    border-radius: 10px;
                }
                
                .custom-scrollbar::-webkit-scrollbar-thumb:hover {
                    background: rgba(239, 68, 68, 0.8);
                }
            `}</style>
        </div>
    );
};

export default Projects;
